import React, { useState } from "react";
import "./app.css";

// Import all components
import Chat from './components/Chat';
import './components/Chat.css';
import AICoach from './components/AICoach';
import Therapy from './components/Therapy';
import Community from './components/Community';
import Report from './components/Report';
import Profile from './components/Profile';
import GamesModal from './components/GamesModal';
import AICoachModal from './components/AICoachModal';
import SleepCompanionModal from './components/SleepCompanionModal';
import MoodReportModal from './components/MoodReportModal';
import PremiumPlans from './components/PremiumPlans';
import BreathingExercise from './components/BreathingExercise';
import JournalModal from './components/JournalModal';
import ShopModal from './components/ShopModal';
import BookingModal from './components/BookingModal';

function App({ user, onLogout, onUpdateUser }) {
    const [activeTab, setActiveTab] = useState("chat");
    
    // Modal Visibility State
    const [showGamesModal, setShowGamesModal] = useState(false);
    const [showBreathing, setShowBreathing] = useState(false);
    const [showAICoach, setShowAICoach] = useState(false);
    const [showSleepCompanion, setShowSleepCompanion] = useState(false);
    const [showMoodReport, setShowMoodReport] = useState(false);
    const [showPremiumPlans, setShowPremiumPlans] = useState(false);
    const [showJournalModal, setShowJournalModal] = useState(false);
    const [showShopModal, setShowShopModal] = useState(false);
    const [showBookingModal, setShowBookingModal] = useState(false);

    const handleUpdateUser = (updatedData) => {
        const newUserData = { ...user, ...updatedData };
        if (onUpdateUser) {
            onUpdateUser(newUserData);
        }
    };

    const handleSubscribe = async (plan) => {
        try {
            console.log(`Subscribing user ${user.id} to ${plan} plan...`);
            handleUpdateUser({ is_premium: 1 });
            alert(`🎉 Welcome to MoodMate Premium! Your ${plan} plan is now active.`);
            setShowPremiumPlans(false);
        } catch (error) {
            alert("Subscription failed. Please try again.");
        }
    };

    const openPremiumPlans = () => {
        setShowPremiumPlans(true);
    };

    const handleJournalEntry = () => {
        // Add coins for journaling
        handleUpdateUser({ 
            coins: (user.coins || 0) + 5,
            streak: (user.streak || 0) + 1 
        });
        setShowJournalModal(true);
    };

    return (
        <div className={`app-container ${user.currentTheme || 'default'}-theme`}>
            <header className="app-header">
                <div className="header-left">
                    <h1>🌙 MoodMate</h1>
                    <span className="status-indicator"></span>
                </div>
                <div className="header-right">
                    <div className="user-stats">
                        <span className="streak-display">🔥 {user.streak || 0}</span>
                        <span>🪙 {user.coins || 0}</span>
                        {user.is_premium ? (
                            <span className="premium-indicator">🌟 Premium</span>
                        ) : (
                            <span className="premium-indicator-locked">💎 Basic</span>
                        )}
                    </div>
                    <div className="user-info">
                        <span className="user-name">{user.username}</span>
                    </div>
                    <button onClick={onLogout} className="logout-btn">Logout</button>
                </div>
            </header>
            
            <nav className="app-nav">
                <button 
                    className={activeTab === "chat" ? "active" : ""} 
                    onClick={() => setActiveTab("chat")}
                >
                    💬 Chat
                </button>
                <button 
                    className={activeTab === "ai-coach" ? "active" : ""} 
                    onClick={() => setActiveTab("ai-coach")}
                >
                    🤖 AI Coach
                </button>
                <button 
                    className={activeTab === "therapy" ? "active" : ""} 
                    onClick={() => setActiveTab("therapy")}
                >
                    👨‍⚕️ Therapy
                </button>
                <button 
                    className={activeTab === "community" ? "active" : ""} 
                    onClick={() => setActiveTab("community")}
                >
                    🌍 Community
                </button>
                <button 
                    className={activeTab === "report" ? "active" : ""} 
                    onClick={() => setActiveTab("report")}
                >
                    📊 Report
                </button>
                <button 
                    className={activeTab === "profile" ? "active" : ""} 
                    onClick={() => setActiveTab("profile")}
                >
                    👤 Profile
                </button>
            </nav>

            <main className="app-main">
                {activeTab === 'chat' && <Chat user={user} />}
                {activeTab === 'ai-coach' && (
                    <AICoach 
                        user={user} 
                        onUpgradeClick={openPremiumPlans}
                        onShowAICoach={() => setShowAICoach(true)}
                    />
                )}
                {activeTab === 'therapy' && (
                    <Therapy 
                        user={user} 
                        onUpdateUser={handleUpdateUser}
                        onShowBooking={() => setShowBookingModal(true)}
                    />
                )}
                {activeTab === 'community' && (
                    <Community 
                        user={user} 
                        onUpdateUser={handleUpdateUser}
                    />
                )}
                {activeTab === 'report' && (
                    <Report 
                        user={user} 
                        onUpgradeClick={openPremiumPlans}
                        onShowReport={() => setShowMoodReport(true)}
                    />
                )}
                {activeTab === 'profile' && (
                    <Profile 
                        user={user} 
                        onUpdateUser={handleUpdateUser} 
                        onUpgradeClick={openPremiumPlans}
                        onShowReport={() => setShowMoodReport(true)}
                        onShowGames={() => setShowGamesModal(true)}
                        onShowBreathing={() => setShowBreathing(true)}
                        onShowSleep={() => setShowSleepCompanion(true)}
                        onShowAICoach={() => setShowAICoach(true)}
                        onShowJournal={handleJournalEntry}
                        onShowShop={() => setShowShopModal(true)}
                    />
                )}
            </main>

            {/* All top-level Modals */}
            {showPremiumPlans && (
                <PremiumPlans 
                    user={user} 
                    onSubscribe={handleSubscribe} 
                    onClose={() => setShowPremiumPlans(false)} 
                />
            )}
            {showGamesModal && (
                <GamesModal 
                    user={user} 
                    onClose={() => setShowGamesModal(false)} 
                    onUpgradeClick={openPremiumPlans} 
                />
            )}
            {showAICoach && (
                <AICoachModal 
                    user={user} 
                    onClose={() => setShowAICoach(false)} 
                    onUpgradeClick={openPremiumPlans} 
                />
            )}
            {showSleepCompanion && (
                <SleepCompanionModal 
                    user={user} 
                    onClose={() => setShowSleepCompanion(false)} 
                    onUpgradeClick={openPremiumPlans} 
                />
            )}
            {showMoodReport && (
                <MoodReportModal 
                    user={user} 
                    onClose={() => setShowMoodReport(false)} 
                    onUpgradeClick={openPremiumPlans} 
                />
            )}
            {showJournalModal && (
                <JournalModal 
                    user={user}
                    onClose={() => setShowJournalModal(false)}
                    onUpdateUser={handleUpdateUser}
                />
            )}
            {showShopModal && (
                <ShopModal 
                    user={user}
                    onClose={() => setShowShopModal(false)}
                    onUpdateUser={handleUpdateUser}
                />
            )}
            {showBookingModal && (
                <BookingModal 
                    user={user}
                    onClose={() => setShowBookingModal(false)}
                />
            )}
            {showBreathing && <BreathingExercise onClose={() => setShowBreathing(false)} />}
        </div>
    );
}

export default App;
